        <Route path="/post" component={Post}></Route>
      </View>
    </NativeRouter>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
    fontFamily: 'IBM Plex Sans',
    width: 390,
    marginLeft: 200,
  },
});

AppRegistry.registerComponent('MyApp', () => App);
